 res:Johann_Sebastian_Bach dbo:birthPlace ?uri .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
ASK 
WHERE {
 OPTIONAL { res:Frank_Herbert dbo:deathDate ?date . }
 FILTER (!BOUND(?date))
}

